import { storeConstants } from 'library/common/constants';

export const saveEmployeeDetail = (data) => dispatch => {
    let storeData = store.getState().employeeDetails;
    storeData.push(data);
    dispatch({
        type: storeConstants.SAVE_EMPLOYEE,
        payload: storeData,
    });
};
